import React, { useState } from 'react';
import TinderCard from 'react-tinder-card';
import "./TinderCards.css";
function TinderCards() {
  const [people, setPeople] = useState([
    {
      name: 'steve jobs',
      url: 'https://www.biography.com/.image/ar_1:1%2Cc_fill%2Ccs_srgb%2Cfl_progressive%2Cq_auto:good%2Cw_1200/MTY2MzU3OTcxMTUwODQxNTM1/steve-jobs--david-paul-morrisbloomberg-via-getty-images.jpg'
    },
    {
      name: 'mark zuckerberg',
      url: 'https://media.wired.com/photos/592676467034dc5f91beb80e/master/pass/MarkZuckerberg.jpg'
    }
  ]);

  return (
    <div>
      <TinderCard>assa</TinderCard>
      <h1>Tinder cards</h1>

      <div className="tinderCards__cardContainer">
        {people.map(person => {
          return <TinderCard
            className="swipe"
            key={person.name}
            preventSwipe={['up', 'down']}
          >
            <div
              style={{ backgroundImage: `url(${person.url})` }}
              className="card">
              <h3>{person.name}</h3>
            </div>
          </TinderCard>
        })}
      </div>
    </div>
  )
}

export default TinderCards;
